import React, {ChangeEvent, ReactNode} from "react";
import Input from '../General/Input';
import minusIcon from '../../img/minus-icon-red-t.png';

interface UserProps {
    id: string,
    pseudo: string,
    writeRight: boolean,
    icon: string,
    delete: (event: React.ChangeEvent<HTMLInputElement>) => void,
}

class User extends React.Component<UserProps, any> {
    public render(): ReactNode {
        return (
            <div id={'user-' + this.props.id} className={'user-card row mt-5 col-lg-12 col-md-12 col-sm-12 col-xs-12'}>
                <div
                    className={'col-lg-2 col-md-2 col-sm-2 col-xs-2 mt-lg-4 mt-md-4 mt-sm-4 mt-xs-4 pl-lg-0 pl-md-0 pl-sm-0 pl-xs-0 pr-lg-0 pr-md-0 pr-sm-0 pr-xs-0'}
                    >
                    <h3
                        className={'col-12'}
                    >{this.props.pseudo}</h3>
                    <img
                        id={'user-remove-' + this.props.id}
                        src={minusIcon}
                        alt={'Minus Icon'}
                        className={'remove-button plus-icon ml-5 mr-0'}
                        />
                </div>
                <div
                    className={'col-lg-10 col-md-10 col-sm-10 col-xs-10'}
                    >
                    <img src={this.props.icon}/>
                    <Input
                        id={this.props.id}
                        inputType={'checkbox'}
                        placeholder={''}
                        className={''}
                        onChange={this.props.delete}
                        />
                </div>
                <h1>{this.props.id}</h1>
                <h2></h2>
                <h3>{this.props.writeRight}</h3>
            </div>
        );
    }
}

export default User;
